import React from "react";
import {SafeAreaView, ScrollView} from "react-native";
import {Appbar} from "react-native-paper";

export const RegisterScreen = () => {
    return (
        <SafeAreaView>
            <ScrollView>
                <Appbar>
                    <Appbar.BackAction />
                        <Appbar.Content tile="Register" />

                </Appbar>
            </ScrollView>
        </SafeAreaView>
    )
}
